import ApartmentCard from "../components/ApartmentCard";
import "../styles/App.css";

export default function Bookmarks() {
  const bookmarkedApartments = [
    {
      id: 2,
      title: "Luxury Villa",
      location: "Los Angeles",
      price: 2500,
      imageURL: "https://via.placeholder.com/300",
      status: "rented",
      isBookmarked: true,
    },
  ];

  return (
    <div>
      <h1>Bookmarked Apartments</h1>
      <div className="apartment-grid">
        {bookmarkedApartments.length > 0 ? (
          bookmarkedApartments.map((apt) => <ApartmentCard key={apt.id} {...apt} />)
        ) : (
          <p>No bookmarks yet.</p>
        )}
      </div>
    </div>
  );
}
